import React, { Component } from "react";

class songPanel extends Component {
    state = {
        title: "Way 2 Sexy",
        artist: "Drake Featuring Future & Young Thug",
        picture:
            "https://charts-static.billboard.com/img/2021/09/drake-p3d-way-2-sexy-hhn-155x155.jpg",
    };

    render() {
        return (
            <div>
                <div className="card" style={{ width: "18rem" }}>
                    <img src={this.state.picture} class="card-img-left" />
                    <div class="card-body">
                        <h5 class="card-title">{this.state.title}</h5>
                        <p class="card-text">{this.state.artist}</p>
                        <a href="#" class="btn btn-primary">
                            Go somewhere
                        </a>
                    </div>
                </div>
            </div>
        );
    }
}

export default songPanel;
